import React from 'react';
import { Switch } from 'react-router-dom';

import Route from './Route';

import Signln from '../pages/Signln';
import SignUp from '../pages/SignUp';
import ForgotPassword from '../pages/ForgotPassword';
import ResetPassword from '../pages/ResetPassword';
import Dashboard from '../pages/Dashboard';
import Profile from '../pages/Profile';
import ChangePassword from '../pages/ChangePassword';

const Routes: React.FC = () => (
    <Switch>
        <Route path="/" exact component={Signln} />
        <Route path="/criar-conta" component={SignUp} />
        <Route path="/forgot-password" component={ForgotPassword} />
        <Route path="/reset-password" component={ResetPassword} />

        <Route path="/dashboard" component={Dashboard} isPrivate={true} />
        <Route path="/profile" component={Profile} isPrivate={true} />
        <Route path="/changePassword" component={ChangePassword} isPrivate={true} />
    </Switch>
)

export default Routes;
